CREATE TABLE "dev"."main"."q02" AS SELECT s_acctbal, s_name, n_name, p_partkey, p_mfgr, s_address, s_phone, s_comment FROM "dev"."tpch"."part", "dev"."tpch"."supplier", "dev"."tpch"."partsupp", "dev"."tpch"."nation", "dev"."tpch"."region" WHERE p_partkey = ps_partkey AND s_suppkey = ps_suppkey AND p_size = 15 AND p_type LIKE '%BRASS' AND s_nationkey = n_nationkey AND n_regionkey = r_regionkey AND r_name = 'EUROPE' AND ps_supplycost = (SELECT MIN(ps_supplycost) FROM "dev"."tpch"."partsupp", "dev"."tpch"."supplier", "dev"."tpch"."nation", "dev"."tpch"."region" WHERE p_partkey = ps_partkey AND s_suppkey = ps_suppkey AND s_nationkey = n_nationkey AND n_regionkey = r_regionkey AND r_name = 'EUROPE') ORDER BY s_acctbal DESC, n_name NULLS FIRST, s_name NULLS FIRST, p_partkey NULLS FIRST LIMIT 100